        "Name": "Solvente dos Sonhos",
        "Desc": "Um item capaz de mudar os Materiais de Elevao de Personagem obtidos a partir de memrias e julgamentos para qualquer forma que seja necessria.<br>As pessoas outrora acreditavam que os espritos e as memrias tinham alguma forma material. Se algum sonhou com o cu antes de acordar agarrando uma flor, ento essa flor deve ter sido feita a partir de tal fantasia. O Solvente dos Sonhos dissolve o que se obtm da memria e o transforma em algum outro sonho.<br>De fato, os golpes trocados com os mais fortes so apenas obstculos para que voc mesmo se torne mais forte.",
