    "100957": {
        "_id": 100957,
        "R": 5,
        "Name": "Mscara Funerria",
        "Desc": "Trofu obtido aps derrotar a \"Oitava dos Onze Mensageiros dos Fatui: Signora\".<br>Os Fatui sempre usam mscaras. Dizem que  porque depois de se tornarem Fatui, todo o seu passado e o seu \"eu\" anterior no tm mais importncia. Por isso, eles desistem de seu nome e aparncia verdadeiros.<br><br>No entanto, o ato de deixar para trs seu \"eu\", todas suas aes passadas e seus laos  algo bastante difcil.<br>Seria justo dizer que apenas aqueles que tm uma obsesso perto ou at excedendo o nvel de uma Iluso estariam dispostos a se juntar a esse grupo contra os Princpios Celestiais, vinculando seus dias restantes a suas Iluses e queimando como estrelas brilhantes.<br>... claro que muitos nos Fatui so apenas consumidos por poder ou so sdicos, e isso no  necessariamente uma contradio.<br><br>A mulher com o nome verdadeiro Rosalyne-Kruzchka Lohefalter antes era inocente e ingnua.<br>Mas isso foi antes de seus olhos se encherem de chamas de fria e de seus dias inocentes serem queimados. Antes da Iluso de gelo apagar as lnguas em chamas que devoraram ela. Antes do poder gelado que protegia ela ser despedaado por uma forasteira, livre mas no menos determinada que ela, causando a exploso das chamas mais uma vez...",
        "Src": [],
        "Icon": "UI_ItemIcon_100957"
    },
    "120127": {
        "_id": 120127,
        "R": 5,
        "Name": "Galho Primrio",
        "Desc": "Um novo ramo foi recolhido do centro do mundo.<br>Antes havia uma enorme rvore que atuava em todas as partes do mundo; este ramo fazia parte dela. Embora tenha sido quebrado, este ramo nunca perdeu a ligao que tinha com a rvore. Dessa forma, enquanto a madeira daquela gigante branca, que simboliza o centro do mundo, no morrer, o ramo tambm nunca murchar.<br><br>\"rvore\"  um smbolo de vida. Nas histrias do mundo todo sempre h algum que, em seu leito de morte, confia seus pensamentos aos galhos de alguma rvore branca.  por isso que vida e a esperana no sero perdidas, e ramos crescero e brotaro em lugares onde houve sol, chuva e orvalho para por fim florescer e dar frutos.<br>E \"rvore\" tambm  smbolo de sabedoria. Nas lendas de alguma parte do mundo, um sbio pendurado de cabea para baixo em uma rvore obteve o conhecimento de escrever runas, e o reino construdo atravs da raiz da rvore finalmente conseguiu um vislumbre do segredo do submundo.<br>Todo conhecimento, memria e experincia fluem nas razes desta rvore. Assim como riachos fluem para rios, e rios para o oceano, eles voltam a se transformar em chuva e caem sobre a terra. Assim como a vida.",
        "Src": [],
        "Icon": "UI_ItemIcon_120127"
    },
    "129001": {
        "_id": 129001,
        "R": 5,
        "Name": "Lgrima das Estrelas",
        "Desc": "Uma gota d'gua obtida de dentro da besta colossal que cobiou o mar primordial da vida.<br><br>Um filsofo do longnquo mundo antigo afirmou certa vez que onde h vida, h morte; naturalmente, onde h morte, h vida.<br>Se no, a luz fugaz no conseguiria resistir  escurido eterna, e tudo se transformar em absoluto nada no fim dos tempos.<br>As regras entre as estrelas ditam que a natureza deve ser preservada, mas as leis do universo nunca foram preservadas.<br>Em uma caixa selada, a destruio sempre supera a nova vida. Milnios e milnios de prosperidade so apenas um instante em um perodo de bilhes de anos. As maiores conquistas, as realizaes mais orgulhosas, com o tempo, todas elas sero maculadas, se deterioraro, se dissiparo e, por fim, cairo no esquecimento.<br>Assim so as coisas flutuando entre as estrelas, outrora adornadas com inmeros ttulos de prestgio de inmeras civilizaes, derramando lgrimas por sua morte ordenada.<br>Suas lgrimas desabam, por desespero, por esperana, pois todo desespero e esperana sero totalmente extintos junto com as inmeras estrelas.<br>Cada minscula silhueta, porm bela, e cada momento digno de ser lembrado, desaparecer com o tempo, at mesmo as estrelas.<br>E ento, existem os tais \"deuses\" que esto determinados a salvar tudo que merea ser salvo, e devorar tudo que deveria ser devorado.<br>At o fim dos tempos, at que o mar de estrelas se torne nada alm de brasas que lentamente se apagam, at que um \"mundo\" recm-nascido se mova pela primeira vez no estmago da baleia.<br>\"No existiro mais pecados, nem tristeza, nem lgrimas, pois tudo ter morrido com as antigas estrelas\".",
        "Src": [],
        "Icon": "UI_ItemIcon_129001"
    },
